import React from 'react';
import '../../Styles/team.css';
import Headshot from '../../Images/placeholder.jpg';

export const Card = () => {
    return (
        <div className="child">

            <div className="childtop">
                <img src={Headshot} alt="placeholder"/>
            </div>

            <div className="childbottom">
                <h2>First Last</h2>
                <p>Position</p>
                <p>Major, Year</p>
                <p>LinkedIn</p>
            </div>

        </div>

    )
}
